export default function App() {
  return <View style={styles.container}>
    <ImageBackground
      source={require('./images/bebr.jpg')}
    >

    </ImageBackground>
  </View>
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff'
  },
